import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
    return (
        <div>
            <h1>Welcome to the Student Report Generation App</h1>
            <p>Generate detailed reports for your students easily.</p>
            <Link to="/report-form">Create a New Report</Link>
        </div>
    );
};

export default Home;
